Designed by @vanessa_graphicdesigner";}i:199;a:1:{s:14:"comments_count";i:0;}i:200;a:1:{s:11:"likes_count";i:0;}i:201;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuapM0g7oO";}i:202;a:1:{s:5:"image";s:259:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118823998_172886774368660_3787782142256798328_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=104&_nc_ohc=dNEhGinxFa4AX-lGXcT&_nc_tp=15&oh=892e87f0118c21c6d0694fecdce8f323&oe=5F7B67DC";}i:203;a:1:{s:4:"type";s:5:"image";}i:204;a:1:{s:8:"owner_id";i:3058395768;}i:205;a:1:{s:14:"owner_username";s:0:"";}i:206;a:1:{s:14:"owner_fullname";s:0:"";}i:207;a:1:{s:9:"owner_pic";s:0:"";}i:208;a:1:{s:2:"id";s:19:"2390965209415311128";}i:209;a:1:{s:10:"short_code";s:11:"CEuajCphF8Y";}i:210;a:1:{s:12:"created_time";i:1599245285;}i:211;a:1:{s:7:"caption";s:2173:"One week today we received the devastating news of our first and only Superhero Chadwick Boseman . Not only was he our Superhero in a movie but also a Superhero in real life. 

I don’t watch many movies at all and the one movie I went to go see at the theatre in a very, very long time was Black Panther. I remember the big hype and the excitement to go and see this movie like it was yesterday. A movie that made our community proud. Our very first black superhero movie.

The one scene that stood out to me the most was.

King T'Chaka : What is wrong, my son?
T'Challa : I am not ready, Baba.
King T'Chaka : Have you not prepared to be king your whole life? Have you not trained and studied, been by my side?
T'Challa : That is not what I am talking about. I am not ready to be without you.
King T'Chaka : A man who has not prepared his children for his own death has failed as a father. Have I ever failed you?
King T'Chaka : Never.

Wow, I could not believe my ears because in most cases death, and, or anything to do with death is often taboo. I have never ever heard of any one, or any parent, preparing their child/children for the unthinkable BUT, what a difference our world would be, if we did.

Being our best self and living to our full potential leaves an amazing legacy to our loved ones to follow. We would be raising more and more superheroes.

One of my favourite quotes is “ No harm hoping for the best as long as you are prepared for the worst”.

Life is too short..

Do you have a Will? 
Does your family know your final wishes? 
Pre-planning is an act of love and a way to leave a positive legacy of you to your loved ones during the most difficult time of their life.

Don't wait before it is too late...

Chadwick Boseman, we thank you for being our Superhero on screen and off screen. We thank you for the lessons that you left us. We thank you for being our King and being such an example to our husbands, brothers and children. Most of all we thank you for the amazing legacy you have left for our community.

You will be missed but never ever forgotten.

